import classes from '../../pages/AvailableMeals.module.css';
import MealItem from '../Meals/MealItem/MealItem';

const MealsList = ({meals}) => {
    return (
        <div className={classes.meals}>
      <ul>
        {meals.map((meal) => (
             <MealItem
                id={meal.id}
                key={meal.id}
                name={meal.name}  
                description={meal.description}
                price={meal.price}
                />
        ))}
      </ul>
    </div>
    )

}

export default MealsList;
